import React,{ useState } from 'react';
import './App.css';

function App() {
   const[activeTab,setActiveTab]= useState('image-generator');
   const handleTabChange=(tab)=>{
   // alert(tab)
    setActiveTab(tab)
   }

  return (
    <div className="App">
      <button onClick={()=>handleTabChange('image-generator')}>Image Generator</button>
      <button onClick={()=>handleTabChange('chat')}>Chat</button>
      <button onClick={()=>handleTabChange('receipe-generator')}>Receipe Generator</button>

    <div>
     {}

      {activeTab=== 'image-generator' && <h2>Image Generator</h2>}
      {activeTab=== 'chat' && <h2>Chat</h2>}
      {activeTab=== 'receipe-generator' && <h2>Receipe Generator</h2>}
    </div>




    </div>



  );
}

export default App;
